import { Component } from "react";
import "./App.css";

class App extends Component {
  constructor() {
    super();

    this.state = {
      monsters: [
        {
          name: "Frankenstein",
        },
        {
          name: "Hulk",
        },
        {
          name: "Freaky",
        },
      ],
    };
  }

  render() {
    return (
      <div className="App">

      </div>
    );
  }
}

export default App;
